import React from 'react';
import DefaultLayout from '../layouts/DefaultLayout.jsx';
import './_app.jsx';
import cat from "http://placekitten.com/g/200/300";

const Home = () => {
    return (
        <DefaultLayout>
            <h2>
                Welcome to Mlo Art where you can buy a unique art. 
                <br/>
                No art piece is alike.
            <img src= "cat" alt= "http://placekitten.com/g/200/300"/>
            </h2>
        </DefaultLayout>
    );
};

export default Home;
